import java.io.*;
import java.util.*;

public class Main {
    static class FastReader {
        BufferedReader br;
        StringTokenizer st;

        public FastReader() {
            br = new BufferedReader(new InputStreamReader(System.in));
        }

        String next() {
            while (st == null || !st.hasMoreElements()) {
                try {
                    st = new StringTokenizer(br.readLine());
                } catch (IOException e) {
                    e.printStackTrace();
                }
            }
            return st.nextToken();
        }

        int nextInt() {
            return Integer.parseInt(next());
        }

        long nextLong() {
            return Long.parseLong(next());
        }

        double nextDouble() {
            return Double.parseDouble(next());
        }

        String nextLine() {
            String str = "";
            try {
                str = br.readLine();
            } catch (IOException e) {
                e.printStackTrace();
            }
            return str;
        }
    }

    public static void main(String[] args) {
        FastReader sc = new FastReader();
        PrintWriter out = new PrintWriter(System.out);
        int n = sc.nextInt();
        long k = sc.nextLong();
        int[] a = new int[n];
        for (int i = 0; i < n; i++) {
            a[i] = sc.nextInt();
        }
        Map<Integer, Integer> map = new HashMap<>();
        for (int i = 0; i < n; i++) {
            map.put(a[i], map.getOrDefault(a[i], 0) + 1);
        }
        int[] b = new int[(int) (n * k)];
        int index = 0;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < k; j++) {
                b[index++] = a[i];
            }
        }
        int[] ans = new int[index];
        int j = 0;
        for (int i = 0; i < index; i++) {
            if (map.get(b[i]) > 0) {
                while (j > 0 && map.get(b[j - 1]) > 0) {
                    map.put(b[j - 1], map.get(b[j - 1]) - 1);
                    j--;
                }
            }
            ans[j++] = b[i];
            map.put(b[i], map.get(b[i]) - 1);
        }
        for (int i = 0; i < j; i++) {
            out.print(ans[i] + " ");
        }
        out.println();
        out.close();
    }
}
